import React from 'react';

function RunningPage() {
  return (
    <div className='RunningPage-main'>
        <div className='RunningPage-strava'>
          <iframe height='454' width='300' src='https://www.strava.com/athletes/70870455/latest-rides/8f823a43d25a51a1bfb4b694dfd0069595143b19'></iframe>
        </div>
        <div className='RunningPage-upcoming-events'></div>
    </div>
  );
}

export default RunningPage;
